import React from 'react';
import { useSelector } from 'react-redux';

const AuthComponents = () => {

    const authComp = useSelector((state) => state?.authReducer?.componentName || undefined);

    // const actionLayoutArea: IActionStateArea = useSelector(state => {
    //     if (state.actionStateLayoutReducer && state.actionStateLayoutReducer.actionStateArea)
    //         return (state.actionStateLayoutReducer as IActionStateLayout).actionStateArea
    //     else return undefined
    // });
    console.log("authComp==>", +authComp);

    return (
        <>
            {authComp &&
                <>
                    <div>
                        <authComp/>
                    </div>
                    <div className="popup-backdrop">
                    </div>
                </>
            }
        </>
    )
}

export default (AuthComponents);
